import styled from 'styled-components'

const Outer = styled.div`
    img {
        border-radius: 50%;
    }

    ul {
        text-align: center;
    }

    li {
        display: inline;
        margin: 5px;

    }

    i {
        font-size: 24px;
    }
`

export default Outer
